alias sdt {
  if ($did($did).state) { set % $+ $1 1 }
  else { unset % $+ $1 }
}
alias _hmake {
  if ($hget($1)) { hfree $1 }
  hmake $1-
}
alias _txtdir { return $+($scriptdir,txt\,$1) }
alias netsel.load {
  if ($ini(servers.ini,servers,0)) {
    window -h @loadnets
    _hmake servtmp
    loadbuf -tservers @loadnets servers.ini
    var %i = $line(@loadnets,0)
    if ($dialog(perform)) { var %nd = $token(%autoperform,0,32) }
    else { var %nd = $var(%nick.def.*,0) }
    while (%i) {
      if ($regex(loadnet,$line(@loadnets,%i),/^n\d+=.+SERVER:.+GROUP:([^:]+)/i)) && ($regml(loadnet,1) !isnum) && (!$hget(servtmp,$v1)) {
        var %t = $regml(loadnet,1), %nn = %autoperform
        if (!$istok(%nn,%t,32)) { did -a $dname 1 %t }
        hadd servtmp $regml(loadnet,1) 1
      }
      dec %i
    }
    hfree servtmp
    close -@ @loadnets
  }
}
alias perforead {
  var %line,%f $_txtdir(perform.txt),%l $lines(%f)
  if ($read(%f,tnw,[[ $+ %previousnet $+ ]])) {
    var %line $readn + 1
    while (%line <= %l) {
      var %r $read(%f,tn,%line)
      if (!$regex(%r,/^\[[^\]\[]+\]$/)) && ($readn <= %l) {
        write -dl %line $qt(%f)
        dec %l
      }
      else { break }
    }
  }
  if ($didtok($dname,11,10).text == $null) {
    if (%line) write -dl $calc(%line -1) $qt(%f)
  }
  else {
    if (%line) { write -il $v1 $qt(%f) $didtok($dname,11,10).text }
    else { write $qt(%f) [[ $+ %previousnet $+ ]] $+ $crlf $+ $didtok($dname,11,10).text }
  }
}
dialog netsel {
  title "Add network"
  size -1 -1 212 203
  list 1, 6 21 118 177, sort size vsbar
  button "&OK", 2, 131 144 76 23, ok
  button "&Cancel", 3, 131 172 76 23, cancel
  text "Select network:", 4, 8 5 82 14
}
on *:dialog:netsel:*:*:{
  if ($devent == init) { netsel.load }
  elseif ($devent == sclick) {
    if ($did == 2) && ($did(1).seltext) { set %netsel.result $did(1).seltext }
  }
  elseif ($devent == dclick) && ($did == 1) {
    set %netsel.result $did(1).seltext
    dialog -c $dname
  }
}
alias perform { dialog -m perform perform }

dialog perform {
  title "Perform"
  size -1 -1 293 320
  check "E&nable perform on connect", 1, 10 15 155 14
  text "Perform commands:", 2, 10 115 120 14
  text "Network:", 3, 10 45 120 14
  combo 4, 8 61 136 160, size sort drop
  edit "", 11, 8 132 277 147, multi return hsbar vsbar
  button "&Add", 14, 150 61 76 23
  button "&Delete", 15, 150 90 76 23
  button "&OK", 12, 128 289 76 23, ok
  button "&Cancel", 13, 210 289 76 23, cancel
}
on *:dialog:perform:*:*:{
  if ($devent == init) {
    if (%perform.net) { did -c $dname 1 }
    if (%autoperform == $null) { did -ca $dname 4 All Networks | set %previousnet perform }
    else {
      didtok $dname 4 32 %autoperform
      did -c $dname 4 1
      set %previousnet $did(4).seltext
    }
    var %f = $_txtdir(perform.txt)
    if ($read(%f,tnw,[[ $+ %previousnet $+ ]])) loadbuf -ot $+ %previousnet $dname 11 %f
  }
  elseif ($devent == sclick) {
    if ($did == 1) { sdt perform.net }
    elseif ($did == 4) {
      perforead
      var %f $_txtdir(perform.txt)
      did -r $dname 11
      if (%autoperform != $null) { set %previousnet $did(4).seltext }
      if ($read(%f,tnw,[[ $+ %previousnet $+ ]])) loadbuf -ot $+ %previousnet perform 11 $_txtdir(perform.txt)
    }
    elseif ($did == 12) { perforead }
    elseif ($did == 14) {
      perforead
      noop $dialog(netsel,netsel,-4)
      if (%netsel.result) {
        if (%autoperform == $null) { did -d perform 4 1 }
        set %autoperform $addtok(%autoperform,%netsel.result,32)
        did -r $dname 11
        did -ca $dname 4 %netsel.result
        set %previousnet %netsel.result
        unset %netsel.result
      }
    }
    elseif ($did == 15) {
      did -r $dname 4,11
      perforead
      if (%autoperform) {
        var %c $_txtdir(perform.txt)
        set %autoperform $remtok(%autoperform,%previousnet,32)
        didtok $dname 4 32 %autoperform
        did -c $dname 4 1
        set %previousnet $did(4).seltext
        if ($read(%c,tnw,[[ $+ %previousnet $+ ]])) loadbuf -ot $+ %previousnet perform 11 %c
      }
      if (%autoperform == $null) {
        did -ca $dname 4 All Networks
        set %previousnet perform
      }
    }
  }
  elseif ($devent == close) { unset %previousnet }
}

package dev.relismdev.rcore.messages;

import dev.relismdev.rcore.api.socketHandler;
import dev.relismdev.rcore.storage.localStorage;
import dev.relismdev.rcore.storage.loggerStorage;
import org.apache.logging.log4j.Level;
import io.socket.client.Socket;
import org.apache.logging.log4j.core.LogEvent;
import org.apache.logging.log4j.core.appender.AbstractAppender;
import org.apache.logging.log4j.core.config.plugins.Plugin;
import org.apache.logging.log4j.core.layout.PatternLayout;
import org.json.JSONObject;

import java.util.Map;
import java.util.concurrent.ExecutorService;
import java.util.concurrent.Executors;

@Plugin(name = "Log4JAppender", category = "Core", elementType = "appender", printObject = true)
public class consoleListener extends AbstractAppender {

    Socket socket = socketHandler.socket;

    private ExecutorService executor = Executors.newFixedThreadPool(10);
    loggerStorage lgs = new loggerStorage();
    localStorage ls = new localStorage();

    public consoleListener() {
        super("Log4JAppender", null,
                PatternLayout.newBuilder()
                        .withPattern("[%d{HH:mm:ss} %level]: %msg")
                        .build(), false);
    }

    @Override
    public boolean isStarted() {
        return true;
    }

    @Override
    public void append(LogEvent event) {
        // Extract log message data
        String message = event.getMessage().getFormattedMessage();
        Level level = event.getLevel();

        // Build the logData JSON object
        JSONObject logData = new JSONObject();
        logData.put("message", message);
        logData.put("level", level.toString());

        socket.emit("forward", "dashboard", "console-incoming", logData);
    }
}

#include <stdlib.h>
#include <stdio.h>
#include <string.h>
#include <stdbool.h>

/**
 * Objectif
 * Une porte logique est un dispositif électronique qui met en œuvre une fonction booléenne, effectue une opération logique sur une ou plusieurs entrées binaires et produit une seule sortie binaire.
 * 
 * Énoncé :
 * Étant donné n noms de signaux d'entrée et leurs données respectives, et m noms de signaux de sortie avec leur type de porte logique respective et deux noms de signaux d'entrée, fournissez les noms des signaux de sortie m et leurs données respectives, dans le même ordre que ceux fournis dans la description de l'entrée.
 * 
 * Tous les types de portes auront toujours deux entrées et une sortie.
 * Toutes les données des signaux d'entrée ont toujours la même longueur.
 * 
 * Les types de portes sont les suivants :
 * - AND : effectue une opération ET logique.
 * - OR : effectue une opération OU logique.
 * - XOR : effectue une opération OU exclusif logique.
 * - NAND : effectue une opération ET logique inversée.
 * - NOR : effectue une opération OU logique inversée.
 * - NXOR : effectue une opération OU exclusif logique inversée.
 * 
 * Les signaux sont représentés par des caractères de soulignement et de tiret, un soulignement correspondant à un niveau bas (0, ou faux) et un tiret correspondant à un niveau élevé (1, ou vrai).
 **/

char boolToCharLogicGates(bool b) {
    return b ? '-' : '_';
}

bool charToBoolLogicGates(char c) {
    return c == '-' ? true : false;
}

typedef enum {
    AND,
    OR,
    XOR,
    NAND,
    NOR,
    NXOR
} LogicOperator;

bool doOperator(LogicOperator op, bool a, bool b) {
    switch (op) {
        case AND:
            return a && b;
        case OR:
            return a || b;
        case XOR:
            return a != b;
        case NAND:
            return !(a && b);
        case NOR:
            return !(a || b);
        case NXOR:
            return a == b;
        default:
            return false;
    }
}

int main()
{
    int n;
    scanf("%d", &n);
    int m;
    scanf("%d", &m);

    // Traitement des données des signaux d'entrée
    char inputSignals[n][9];
    char inputValues[n][65];
    for (int i = 0; i < n; i++) {
        scanf("%s%s", inputSignals[i], inputValues[i]);
    }

    // Traitement des signaux de sortie
    for (int i = 0; i < m; i++) {
        char outputName[9];
        char type[9];
        char inputName1[9];
        char inputName2[9];
        scanf("%s%s%s%s", outputName, type, inputName1, inputName2);

        // Récupère les données des signaux d'entrée
        char* signalForm1 = NULL;
        char* signalForm2 = NULL;
        for (int j = 0; j < n; j++) {
            if (strcmp(inputSignals[j], inputName1) == 0) {
                signalForm1 = inputValues[j];
            }
            if (strcmp(inputSignals[j], inputName2) == 0) {
                signalForm2 = inputValues[j];
            }
        }
        if (signalForm1 == NULL || signalForm2 == NULL) {
            return 1; // Erreur : signal d'entrée introuvable
        }
        
        int length = strlen(signalForm1) < strlen(signalForm2) ? strlen(signalForm1) : strlen(signalForm2);

        // Détermine le type d'opérateur logique
        LogicOperator gateType;
        if (strcmp(type, "AND") == 0) {
            gateType = AND;
        }
        else if (strcmp(type, "OR") == 0) {
            gateType = OR;
        }
        else if (strcmp(type, "XOR") == 0) {
            gateType = XOR;
        }
        else if (strcmp(type, "NAND") == 0) {
            gateType = NAND;
        }
        else if (strcmp(type, "NOR") == 0) {
            gateType = NOR;
        }
        else if (strcmp(type, "NXOR") == 0) {
            gateType = NXOR;
        }

        // Calcule la sortie
        char outputSignal[65] = "";
        for (int j = 0; j < length; j++) {
            bool signal1 = charToBoolLogicGates(signalForm1[j]);
            bool signal2 = charToBoolLogicGates(signalForm2[j]);
            bool result = doOperator(gateType, signal1, signal2);
            outputSignal[j] = boolToCharLogicGates(result);
        }

        // Affiche le nom de la sortie et le signal
        printf("%s %s\n", outputName, outputSignal);
    }

    return 0;
}

