#include <numeric>

int main()
{
    typedef PriorityCollection<int> PrCollect;
    typedef PrCollect::Id Id;
    int const SIZE = 10;
    std::vector<Id> ids(SIZE);
    std::vector<int> range(SIZE);
    std::iota(range.begin(), range.end(), 0);
    PrCollect collection;
    collection.Add(range.begin(), range.end(), ids.begin());
    int prevMax = SIZE - 1;
    for (int i = 0; i < SIZE; ++i) {
        for (int j = 0; j < i + 1; ++j) {
            collection.Promote(ids[i]);
            auto [item, priority] = collection.GetMax();
            int trueValue = j + 1 >= i ? i : prevMax;
            int truePriority = j + 1 >= i ? j + 1 : i;
            if (item != trueValue || priority != truePriority) {
                puts("Alarm!");
                return 1;
            }
        }
        prevMax = i;
    }
    puts("Good job!");

    return 0;
}

#include <iostream>
#include <string>

using namespace std;

int main() {
    int numberOfGroups;
    cin >> numberOfGroups;
    int musala = 0, montBlanc = 0, kilimanjaro = 0, k2 = 0, everest = 0;
    int totalClimbersSum = 0;

    for (int i = 0; i < numberOfGroups; i++) {
        int currentGroupPeople;
        cin >> currentGroupPeople;

        totalClimbersSum += currentGroupPeople;

        if (currentGroupPeople > 40) {
            everest += currentGroupPeople;
        }
        else if (currentGroupPeople > 25) {
            k2 += currentGroupPeople;
        }
        else if (currentGroupPeople > 12) {
            kilimanjaro += currentGroupPeople;
        }
        else if (currentGroupPeople > 5) {
            montBlanc += currentGroupPeople;
        }
        else if (currentGroupPeople > 0) {
            musala += currentGroupPeople;
        }
    }

    cout.setf(ios::fixed);
    cout.precision(2);

