#include <iostream>

using namespace std;

int main() {
    int tabs, salary;
    cin >> tabs >> salary;

    string apps;

    for (int i = 0; i < tabs && salary > 0; i++) {
        cin >> apps;

        if (apps == "Facebook") {
            salary -= 150;
        }
        else if (apps == "Instagram") {
            salary -= 100;
        }
        else if (apps == "Reddit") {
            salary -= 50;
        }
    }

    if (salary > 0) {
        cout << salary << endl;
    }
    else {
        cout << "You have lost your salary." << endl;
    }
    
    return 0;
}

Решение с тернарен оператор:

#include <iostream>
#include <string>

using namespace std;

int main() {
    int tabs, salary;
    cin >> tabs >> salary;

    string apps;

    for (int i = 0; i < tabs && salary > 0; i++) {
        cin >> apps;

        salary -=
            apps == "Facebook" ? 150 :
            apps == "Instagram" ? 100 :
            apps == "Reddit" ? 50 : 0;
    }

    cout << (salary > 0 ? to_string(salary) : "You have lost your salary.") << endl;
      
    return 0;
}

#include <iostream>
#include<string>
#include<map>

using namespace std;

int main() {
    int age;
    cin >> age;

    double mashinePrice, toyPrice;
    cin >> mashinePrice >> toyPrice;

    double sum = 0;
    int toyCount = 0;
    int birthdayCash = 0;

    for (int i = 1; i <= age; i++) {
        if (i % 2 == 0) {
            birthdayCash += 10;
            sum += birthdayCash - 1;
        }
        else {
            toyCount++;
        }
    }

    sum += toyCount * toyPrice;

    cout.setf(ios::fixed);
    cout.precision(2);

    if (sum >= mashinePrice) {
        cout << "Yes! " << sum - mashinePrice << endl;
    }
    else {
        cout << "No! " << mashinePrice - sum << endl;
    }
    
    return 0;
}
